'''
solutions:
the max no repeat length of substring means that one string must has same symbol at head and tail.
'''


@timer
def test1(s):
    character_dict = {}
    str_len_list = []

    for i, info in enumerate(s):
        if info in character_dict:
            str_len = i - character_dict[info]
            str_len_list.append(str_len)
        character_dict[info] = i

    return max(str_len_list)


@timer
def repeat_again(s: str) -> int:
    """
    use a middle var 'i' to save
    need
    """
    string_dict = dict()
    max_length = 0
    met_repeat = False
    for index, v in enumerate(s):
        if v in string_dict:
            m = index - string_dict[v]
            if m > max_length:
                max_length = m
            met_repeat = True
        string_dict[v] = index

    if met_repeat is True:
        return max_length
    else:
        return len(s)


